import styled, { keyframes } from 'styled-components';

export const Home = styled.div`
  margin-top: 50px;
  position: absolute;
`;



export const BigText = styled.p`
  text-align: center;
  font-size: 48px;
  display: block;
  margin-left: 25%;
`;
